import React from 'react';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";


export default function Popularhotel() {
    var settings = {
        dots: false,
        infinite: false,
        speed: 500,
        slidesToShow: 4,
        slidesToScroll: 4,
        initialSlide: 0,
        responsive: [
            {
                breakpoint: 1024,
                settings: {
                    slidesToShow: 3,
                    slidesToScroll: 3,
                    infinite: true,
                    dots: true
                }
            },
            {
                breakpoint: 600,
                settings: {
                    slidesToShow: 2,
                    slidesToScroll: 2,
                    initialSlide: 2
                }
            },
            {
                breakpoint: 480,
                settings: {
                    slidesToShow: 1,
                    slidesToScroll: 1
                }
            }
        ]
    };
    return (

        <section className='hotelsec'>
            <h1>Most Popular Hotel</h1>

            <Slider {...settings}>
                <figure>
                    <div className='imagwithloc'>
                        <img src='images/popular1.jpg' />
                        <p> <i class="fa-solid fa-location-dot"></i> Vietnam</p>
                    </div>
                    <div className='stars'>
                    <i class="fa-solid fa-star"></i>
                    </div>
                </figure>
            </Slider>
        </section>
    )
}
